import React, { Component } from 'react'
import Typography from '@material-ui/core/Typography'

interface Idata{
    title?: string,
    teacher?: string,
    teacherContacts?: string,
    scienceArea?: string,
    description?: string, 
    reportFile?: string,
    presentationFile?: string,
    consultantReportFile?: string,
    link?: string,
    consultant?: string,
    consultantContacts?: string,
    status?: string,
    id?: string
}

interface Props{
    data?: {}[]
}

interface State{

}

class RequireCriticList extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderItem(item : Idata){
        return(
            <div>
                <Typography variant='h6'>{item.title}, {item.teacher}</Typography>
                <hr/>
            </div>
        )
    }

    private renderRequireCriticList(){
        return(
            <div>
                {this.props.data?.map(item => this.renderItem(item))}
            </div>
        )
    }

    render(){
        return this.renderRequireCriticList();
    }
}

export default RequireCriticList
